import React, { Component } from 'react';

class IntroSlides extends Component {
  render() {
    return (
      <div id="introSlides">
        <div className="background">
					<h1>Here comes my page</h1>
					<h2>Second Header</h2>
					<h3>Third Header</h3>
					<h4>Fourth Header</h4>
					<h5>Fifth Header</h5>
					<p>Where is my font?</p>
				</div>
      </div>
    );
  }
}

export default IntroSlides;
